import React, { Component } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow } from "mdbreact";

class Addeditem extends Component {

    state={
        todoname:'',
        todotime:''
    }

    handelchange

    render() {
      return (
        <div>
                <form>
                    <input type="text" placeholder="enter your plane" id="todoname" onChange={this.handelchange} />
                    <input type="time" placeholder="enter your time" id="todotime" onChange={this.handelchange} />
                    <input type="submit" value="add" />

                </form>

            </div>
      );
    }
  }
  
  export default Addeditem;
